import './Rotation.css';
import logo from '../asset/logo.svg';

const Rotation = () => {
	return (
		<div className="demo">
			<h1>LINEAR ROTATION</h1>
			<img src={logo} className="App-logo" alt="logo" />
		</div>
	);
};

export default Rotation;
